import React from 'react'

const Login = () => {

    const [formData, setFormData] = useState({
        email: "",
        password: ""
    })

    const { email, password } = formData;

    return (
        <section className="login">
            <form>
                <label>Email</label>
                <input name="email" />
                <label>Password</label>
                <input name="password" />
            </form>
        </section>
    )
}

export default Login;
